import Profile from './components/Profile';

const persons = [
  {
    name: 'Geo',
    age: '18',
    hobbies: ['spoerts', 'music']
  },
  {
    name: 'Tom',
    age: '25',
    hobbies: ['movie', 'music']
  },
  {
    name: 'Lisa',
    age: '21',
    hobbies: ['sports', 'travel', 'game']
  }
]

const Example = () => {
  return (
    <>
      <ul>
        {persons.map((person) => (
          <li key={person.name}><Profile {...person} />
          </li>
        ))}
      </ul>
    </>
  );
};

export default Example;
